import React from "react";

const Footer = () => {
  const style = {
    position: "absolute",
    bottom: "0",
    bottom: "env(safe-area-inset-bottom)",
    left: "0",
    right: "0",
    height: "50px",
    borderTop: "1px solid #000",
    padding: "5px",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    fontSize: "13px",
    color: "#dcdcdc",
    transform: "translateY(100%)",
    transition: "all .65s cubic-bezier(.19,1,.22,1) .35s",
  };

  return <div style={style}></div>;
};

export default Footer;
